import { Row } from "react-bootstrap";
import MovieCard from "./MovieCard";


function MovieList({movies}) {
    // console.log(movies);
    return (
        <Row>
            {movies.map((item) => {
                return(
                    <MovieCard key={item.id}/>
                )
            })}
        </Row>
    )
}

export default MovieList ;
